import React from 'react';

import './css/About.css';

class About extends React.Component {


  render () {
    return (
      <div className='About-Section'>
        <p>
          <h3 className='Titles'>About me</h3>
        </p>
        <p>
          <span className='Highligh-Green'>24 let</span><span className='Seperater'>/</span><span className='Highligh-Green'>Břežany II</span><span className='Seperater'>/</span><span className='Highligh-Green'>Freelancer</span>
        </p>
        <p>
          Test about me...
        </p>
      </div>
    );
  }
}

export default About;
